import React , {useEffect ,useState} from 'react'



function ExtraCredit() {
    const [token,setToken] = useState()
    useEffect(() => {
        const fetchToken = async () => {
        const url = 'https://demo.dotcms.com/api/v1/authentication/api-token';

        try {
            const response = await fetch(url, {
            method: 'POST', 
            headers: {
                'Content-Type': 'application/json'            
            },
            body: JSON.stringify({
                user: 'admin@dotcms.com',
                password: 'admin',
                expirationDays: 10,
            }),
            });

            const data = await response.json();

            if (response.ok) {
                console.log('Token:', data);
                setToken(data)
                return
            } else {
                console.error('Error:', data);
                alert('could not get token')
            }
        } catch (error) {
            console.error('Fetch error:', error);
        }
        };

        fetchToken();
        console.log(fetchToken)
    }, []);


  return (
    <div>ExtraCredit { token !== undefined && token.entity.token}</div>
  )
}

export default ExtraCredit
